   function allow(button) {
     if (isButtonLocked(button)) return false;
     lockButton(button);

     var addr = '';
     if (isChecked('allow_notifications')) {
       addr = '&notify=1';
     }
     if (isChecked('denied_email')) {
       addr = '&email_denied=1';
     }
     location.href = "https://login.vk.com/?act=grant_access&client_id=-1&settings=0&redirect_uri=https%3A%2F%2Fvk.com%2Fshare.php%3Furl%3Dhttp%3A%2F%2Fwww.cheapjordans2017.com%2Fcheap-shoes5350%2Fair-jordan-3-gs-whitefire-red-cement-grey-black-womens%2F&response_type=code&group_ids=&direct_hash=7f390d3aa1f6c7456f&token_type=0&v=&state=&display=widget&ip_h=e655c9821e2016a76f&hash=e4d01173a4839be7d6&https=1"+addr;
     return false;
   }

   function cancel() {
     location.href = "https://login.vk.com/?act=grant_access&client_id=-1&settings=0&redirect_uri=https%3A%2F%2Fvk.com%2Fshare.php%3Furl%3Dhttp%3A%2F%2Fwww.cheapjordans2017.com%2Fcheap-shoes5350%2Fair-jordan-3-gs-whitefire-red-cement-grey-black-womens%2F&response_type=code&group_ids=&direct_hash=7f390d3aa1f6c7456f&token_type=0&v=&state=&display=widget&ip_h=e655c9821e2016a76f&hash=e4d01173a4839be7d6&https=1&cancel=1";
     return false;
   }

   function login(button) {
     if (isButtonLocked(button)) return false;
     lockButton(button);
     ge('login_submit').submit();
   }

   function doResize(onResize) {
     onResize && setTimeout(function() {
       doResize()
     }, 100);

     if (!hasClass(document.body, 'oauth_centered') && !onResize) {
       if (window.outerHeight !== void 0) {
         var panelH = (window.outerHeight - window.innerHeight) | 0,
           panelW = (window.outerWidth - window.innerWidth) | 0;
       } else {
         var panelH = 50,
           panelW = 0;
       }
       var contentH = Math.max(ge('oauth_wrap_content').offsetHeight, 430),
         contentW = 655;
       window.resizeTo(contentW + panelW, contentH + panelH);
       window.moveTo(
         (screen.width - contentW) / 2 + (screen.availLeft | 0),
         ((screen.height - contentH) / 2) + (screen.availTop | 0)
       );
     }
   }

   function toggleEmailPrivacy() {
     checkbox('denied_email');
     if (!isChecked('denied_email')) {
       hide('denied_email');
       show('allowed_email');
     } else {
       hide('allowed_email');
       show('denied_email');
     }
   }

   if (parent && parent != window) {
     location.href = "https://oauth.vk.com/blank.html";
   }


